import React, { useState, useEffect } from 'react';
import { useParams } from 'react-router-dom';

export default function ExamResults() {
    const { studentExamId } = useParams();
    const [results, setResults] = useState(null);
    const [loading, setLoading] = useState(true);

    useEffect(() => {
        // Mock results data
        const mockResults = {
            studentExamId: studentExamId,
            examTitle: 'Sample Exam',
            studentName: 'Test Student',
            totalQuestions: 2,
            correctAnswers: 1,
            score: 1,
            totalMarks: 2,
            percentage: 50,
            status: 'COMPLETED',
            submittedAt: new Date().toISOString(),
            answers: [
                {
                    questionId: 1,
                    questionText: 'What is 2 + 2?',
                    selectedOption: 'B',
                    correctOption: 'B',
                    isCorrect: true,
                    marks: 1
                },
                {
                    questionId: 2,
                    questionText: 'What is the capital of France?',
                    selectedOption: 'A',
                    correctOption: 'C',
                    isCorrect: false,
                    marks: 0
                }
            ]
        };

        setResults(mockResults);
        setLoading(false);
    }, [studentExamId]);

    if (loading) return <div>Loading results...</div>;
    if (!results) return <div>Results not found</div>;

    return (
        <div style={{ padding: '20px', maxWidth: '800px', margin: '0 auto', fontFamily: 'Arial, sans-serif' }}>
            {/* Header */}
            <div style={{ 
                padding: '20px',
                background: '#f8f9fa',
                borderRadius: '8px',
                marginBottom: '20px',
                textAlign: 'center'
            }}>
                <h1 style={{ margin: '0 0 10px 0', color: '#333' }}>Exam Results</h1>
                <h2 style={{ margin: '0 0 10px 0', color: '#666' }}>{results.examTitle}</h2>
                <p style={{ margin: 0, color: '#888' }}>
                    Submitted on {new Date(results.submittedAt).toLocaleString()}
                </p>
            </div>

            {/* Score Summary */}
            <div style={{ 
                display: 'grid', 
                gridTemplateColumns: 'repeat(auto-fit, minmax(200px, 1fr))',
                gap: '15px',
                marginBottom: '30px'
            }}>
                <div style={{ 
                    padding: '20px',
                    background: results.percentage >= 60 ? '#d4edda' : '#f8d7da',
                    border: `1px solid ${results.percentage >= 60 ? '#c3e6cb' : '#f5c6cb'}`,
                    borderRadius: '8px',
                    textAlign: 'center'
                }}>
                    <h3 style={{ margin: '0 0 10px 0', fontSize: '24px' }}>
                        {results.score}/{results.totalMarks}
                    </h3>
                    <p style={{ margin: 0, fontWeight: 'bold' }}>Total Score</p>
                </div>

                <div style={{ 
                    padding: '20px',
                    background: '#e2e3e5',
                    border: '1px solid #d6d8db',
                    borderRadius: '8px',
                    textAlign: 'center'
                }}>
                    <h3 style={{ margin: '0 0 10px 0', fontSize: '24px' }}>
                        {results.percentage}%
                    </h3>
                    <p style={{ margin: 0, fontWeight: 'bold' }}>Percentage</p>
                </div>

                <div style={{ 
                    padding: '20px',
                    background: '#d1ecf1',
                    border: '1px solid #bee5eb',
                    borderRadius: '8px',
                    textAlign: 'center'
                }}>
                    <h3 style={{ margin: '0 0 10px 0', fontSize: '24px' }}>
                        {results.correctAnswers}/{results.totalQuestions}
                    </h3>
                    <p style={{ margin: 0, fontWeight: 'bold' }}>Correct Answers</p>
                </div>
            </div>

            {/* Grade */}
            <div style={{ 
                padding: '15px',
                background: results.percentage >= 60 ? '#d4edda' : '#f8d7da',
                border: `1px solid ${results.percentage >= 60 ? '#c3e6cb' : '#f5c6cb'}`,
                borderRadius: '8px',
                textAlign: 'center',
                marginBottom: '30px'
            }}>
                <h2 style={{ margin: 0 }}>
                    Grade: {results.percentage >= 90 ? 'A' : 
                            results.percentage >= 80 ? 'B' : 
                            results.percentage >= 70 ? 'C' : 
                            results.percentage >= 60 ? 'D' : 'F'}
                    {results.percentage >= 60 ? ' - PASS' : ' - FAIL'}
                </h2>
            </div>

            {/* Detailed Answers */}
            <div>
                <h3 style={{ marginBottom: '20px' }}>Answer Review</h3>
                {results.answers.map((answer, index) => (
                    <div key={answer.questionId} style={{ 
                        padding: '20px',
                        border: '1px solid #dee2e6',
                        borderRadius: '8px',
                        marginBottom: '15px',
                        background: answer.isCorrect ? '#f8fff8' : '#fff8f8'
                    }}>
                        <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'flex-start' }}>
                            <div style={{ flex: 1 }}>
                                <h4 style={{ margin: '0 0 10px 0' }}>
                                    Q{index + 1}. {answer.questionText}
                                </h4>
                                <div style={{ marginBottom: '10px' }}>
                                    <strong>Your Answer:</strong> 
                                    <span style={{ 
                                        marginLeft: '10px',
                                        padding: '2px 8px',
                                        background: answer.isCorrect ? '#d4edda' : '#f8d7da',
                                        borderRadius: '4px'
                                    }}>
                                        Option {answer.selectedOption}
                                    </span>
                                </div>
                                {!answer.isCorrect && (
                                    <div>
                                        <strong>Correct Answer:</strong> 
                                        <span style={{ 
                                            marginLeft: '10px',
                                            padding: '2px 8px',
                                            background: '#d4edda',
                                            borderRadius: '4px'
                                        }}>
                                            Option {answer.correctOption}
                                        </span>
                                    </div>
                                )}
                            </div>
                            <div style={{ 
                                padding: '5px 10px',
                                background: answer.isCorrect ? '#28a745' : '#dc3545',
                                color: 'white',
                                borderRadius: '4px',
                                fontWeight: 'bold'
                            }}>
                                {answer.marks}/{answer.marks || 1}
                            </div>
                        </div>
                    </div>
                ))}
            </div>

            {/* Actions */}
            <div style={{ textAlign: 'center', marginTop: '30px' }}>
                <button
                    onClick={() => window.history.back()}
                    style={{
                        padding: '10px 20px',
                        background: '#007bff',
                        color: 'white',
                        border: 'none',
                        borderRadius: '4px',
                        cursor: 'pointer',
                        marginRight: '10px'
                    }}
                >
                    ← Back to Exams
                </button>
                <button
                    onClick={() => window.print()}
                    style={{
                        padding: '10px 20px',
                        background: '#6c757d',
                        color: 'white',
                        border: 'none',
                        borderRadius: '4px',
                        cursor: 'pointer'
                    }}
                >
                    🖨️ Print Results
                </button>
            </div>
        </div>
    );
}
